import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";
import PropTypes from 'prop-types';

import Item from './Items/Itemproduct'

function Home({ products }) {
  return (
    <div style={{'backgroundColor': '#EBFCEB','paddingTop':40+'px','paddingBottom':40+'px'}}>
      <div className="container">
        <Carousel>
          <div>
            <img src='/assets/images/09.jpg' alt="..." />
            <p className="legend">Cactus 1</p>
          </div>
          <div>
            <img src='/assets/images/02.png' alt="..." />
            <p className="legend">Cactus 2</p>
          </div>
          <div>
            <img src='/assets/images/07.jpg' alt="..." />
            <p className="legend">Cactus 3</p>
          </div>
        </Carousel>
      </div>

      <div className="container">
        <h2 className="header-top header-bottom" style={{'marginBottom':40+'px'}}>All Products</h2>
        <div className="d-flex flex-row flex-wrap justify-content-center width-100 mx-5">
        
        {products.length>0 ? (
            products.map((data)=>(
              <Item key={data.id} item={data}/>
          ))
          ):(<h2>No items in cart</h2>)
        }
          </div>
        </div>
      </div>
  );
}

Home.propTypes = {
  products: PropTypes.array.isRequired
};

export default Home
